import React from 'react';
import './HeroSection.css';

import '../App.css';

function AboutUs() {
    return (
        <div className='hero-container'>
        <video src='./videos/CyberTEchDemo.mp4' autoPlay loop muted />

        <div className='hero-container'>
        <video src='./videos/Demoday.mp4' autoPlay loop muted />

    </div>
    </div>
  );
}

export default AboutUs;
